  //       console.log('User is logged in:', user);
  //     } else {
  //       // No user is logged in
  //       console.log('No user is logged in');
  //     }
  //   });

  //   // Clean up the subscription when the component unmounts
  //   return () => unsubscribe();
  // }, []);

