  //   e.preventDefault();
  //   if (email && password) {
  //     try {
  //       if (login) {
  //         // User is trying to log in
  //         await signInWithEmailAndPassword(auth, email, password);
  //         setEmail('');
  //         setPassword('');
  //         navigate("/home");
  //       } else {
  //         // User is trying to sign up
  //         await createUserWithEmailAndPassword(auth, email, password);
  //         if(!login){
  //           setEmail("")
